/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER crear_pronostico
AFTER INSERT ON fakepronostico FOR EACH ROW 
BEGIN 
DECLARE y, x, z integer;
SET y = (SELECT id_equipo FROM `quiniela`.`equipo` where nombre_equipo = NEW.ganador);
SET x = (SELECT id_partido FROM `quiniela`.`partido` where  semana = NEW.semana and (local = y or visitante = y));
SET z = (SELECT id_usuario FROM `quiniela`.`usuario` where nombre = NEW.nom_usu);
INSERT INTO pronostico
(id_usuario, id_partido, ganador, mayor, menor, no_marcador) 
VALUES (z, x, y, NEW.mayor, NEW.menor, NEW.no_marcador);
END */;;
